import Header from "../../components/Header";
import Footer from "../../components/xFooter";
import SecPageImg from "./SecPageImg";
import SecPageTitle from "./SecPageTitle";


function PageFriend() {
    return (
        <>
            <Header />
            <SecPageImg />
            <SecPageTitle />
            <Footer />
        </>
    )
};

export default PageFriend;
